import React from "react";
import BootstrapTable from "react-bootstrap-table-next";

const data = [];

const columns = [
  {
    dataField: "id",
    text: "Product ID"
  },
  {
    dataField: "name",
    text: "Product Name"
  },
  {
    dataField: "price",
    text: "Product Price"
  }
];

export default class Table extends React.Component {
  render() {
    return (
      <div>
        <BootstrapTable
          keyField="id"
          data={this.state.data}
          columns={this.state.columns}
        />
      </div>
    );
  }
}
